import React from 'react';

// styles
import '../../../public/index.css'

const Categories = () => {
    return (
        <div className="categories-container"> 
            <div className="categories__left"><p>Categories left</p></div>
            <div className="categories__right"><p>Categories right</p></div>
        </div>
    )
}

export default Categories
